import React from "react";
import { Button } from "antd";
import Logo from "../../../assets/images/png/LogoMenuTop.png";
import { MenuFoldOutlined, PoweroffOutlined } from "@ant-design/icons";
import "./MenuTop.scss";
export default function (props) {
  const { menuCollapsed, setMenuCollapsed } = props;

  return (
    <div className="menu-top">
      <div className="menu-top-left">
        <img className="menu-top-left-logo" src={Logo} alt="logo" />
        <Button
          type="link"
          title="afda"
          onClick={() => setMenuCollapsed(!menuCollapsed)}
        >
          <MenuFoldOutlined />
        </Button>
      </div>
      <div className="menu-top-right">
        <Button
          className="btn-shutdown"
          type="link"
          onClick={() => console.log("Desconexion")}
        >
          <PoweroffOutlined></PoweroffOutlined>
        </Button>
      </div>
    </div>
  );
}
